<!DOCTYPE html>
<html lang="en">
<head>
    <meta charset="UTF-8">
    <meta http-equiv="X-UA-Compatible" content="IE=edge">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title>Colabor 2023, Creative Coding HSLU</title>

    <style>
        body{
            background-color: black;
            padding: 50px 20px 20px 20px;
        }

        #graphic-container{
            width: 100%;
            max-width: 1000px;
            margin: 0 auto;
            position: relative;
            height: fit-content;
        }

        #graphic-container #logo-main{
            width: 100%;
        }

        #graphic-container #logo-addition{
            width: 75%;
            position: absolute;
            right: 20%;
            bottom: 0;
            transform: translateY(20%) translateX(30%);
            z-index: 2;;
        }

        #graphic-container #title{
            width: 75%;
            position: absolute;
            left: -20px;
            bottom: 0;
            transform: translateY(30%) translateX(-20%);
        }

        #graphic-container h2{
           position: absolute;
           width: 60%;
           right: -20px;
           font-family: sans-serif;
           font-style: italic;
           font-weight: 600;
           letter-spacing: 1px;
           font-size: 30px;
           bottom: -14%;
        }

        #graphic-container h2 span{
            display: block;
            background: white;
            color: black;
            padding: 7px 14px;
            border: 2px solid black;
            border-radius: 60px;
            width: fit-content;
            margin-bottom: -4px;
        }

        #graphic-container h2 span:last-of-type{
            margin-left: 60px;
            background: black;
            color: white;
            border-color: white;
        }

        #button{
            display: block;
            width: fit-content;
            padding: 15px 40px;
            border-radius: 60px;
            font-family: sans-serif;
            text-decoration: none;
            position: fixed;
            left: 50%;
            bottom: 10vh;
            transform: translateX(-50%) scale(1);
            border: 2px solid white;
            color: white;
            font-weight: 600;
            font-size: 25px;
            transition: all 0.3s ease;

        }

        #button:hover{
            background: white;
            border: 2px solid black;
            -webkit-text-stroke: 1.5px black;
            transform: translateX(-50%) scale(1.05);
        }

    </style>
</head>
